import React, { useEffect, useState } from 'react';
import axios from 'axios';

function OrderItemsList() {
  const [orderItems, setOrderItems] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/order-items')
      .then(response => setOrderItems(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>Lista Zamówień (Order Items)</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Klient ID</th>
            <th>Produkt ID</th>
            <th>Czas ID</th>
            <th>Ilość</th>
            <th>Wartość</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {orderItems.map((orderItem, index) => (
            <tr key={index}>
              <td data-label="ID">{index + 1}</td>
              <td data-label="Klient ID">{orderItem.klient_id}</td>
              <td data-label="Produkt ID">{orderItem.produkt_id}</td>
              <td data-label="Czas ID">{orderItem.czas_id}</td>
              <td data-label="Ilość">{orderItem.ilosc}</td>
              <td data-label="Wartość">{orderItem.wartosc} zł</td>
              <td data-label="Status">{orderItem.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrderItemsList;
